import React, { useState } from "react";

const CardUpdate = ({ info }) => {
  const [e_name, setename] = useState(info.e_name);
  const [showModal, setShowModal] = useState(false);

  const updateinfo = async (e) => {
    e.preventDefault();
    try {
      const body = { e_name };
      const response = await fetch(`http://localhost:3000/api/v1/employee/${info.id}`, {
        method: "PUT",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(body),
      });
      console.log(response);
      window.location = "/";
    } catch (err) {
      console.error(err.message);
    }
  };

  return (
    <>
        <button
        type="button"
        className="bg-yellow-500 text-white font-bold py-2 px-4 rounded"
        data-target={`#id${info.info_id}`}
        id={`id${info.id}`}
        onClick={() => {
        setename(info.e_name);
        setShowModal(true);
        }}
      >
        Edit
      </button>

      {showModal && (
        <div className="fixed text-black inset-0 z-50 flex items-center justify-center overflow-x-hidden overflow-y-auto outline-none focus:outline-none">
          <div className="relative w-auto max-w-3xl mx-auto my-6">
            <div className="border-0 rounded-lg shadow-lg relative flex flex-col w-full bg-white outline-none focus:outline-none">
              <div className="flex items-start justify-between p-5 border-b border-solid border-gray-300 rounded-t">
                <h3 className="text-3xl font-semibold text-black">Edit Info</h3>
                <p>Email: {info.e_email}</p>
  <p>Age: {info.e_age}</p>
                <button
                  className="p-1 ml-auto bg-transparent border-0 text-black float-right text-3xl leading-none font-semibold outline-none focus:outline-none"
                  onClick={() => setShowModal(false)}
                >
                  <span className="bg-transparent text-black h-6 w-6 text-2xl block outline-none focus:outline-none">
                    Ã—
                  </span>
                </button>
              </div>

              <div className="relative p-6 flex-auto">
                <input
                  type="text"
                  className="w-full p-2 border border-gray-300 rounded mt-2"
                  value={e_name}
                  onChange={(e) => setename(e.target.value)}
                />
              </div>

              <div className="flex items-center justify-end p-6 border-t border-solid border-gray-300 rounded-b">
                <button
                  className="text-red-500 background-transparent font-bold uppercase px-6 py-2 text-sm outline-none focus:outline-none mr-1 mb-1"
                  type="button"
                  onClick={() => setShowModal(false)}
                >
                  Close
                </button>
                <button
                  className="bg-yellow-500 text-white font-bold uppercase text-sm px-6 py-3 rounded shadow hover:shadow-lg outline-none focus:outline-none mr-1 mb-1"
                  type="button"
                  onClick={(e) => {
                    updateinfo(e);
                    setShowModal(false);
                  }}
                >
                  Save Changes
                </button>
              </div>
            </div>
          </div>
          <div className="opacity-25  inset-0 z-40 bg-black"></div>
        </div>
      )}
    </>
  );
};

export default CardUpdate;
